column13:
Compounds of formula I
   in which [R¹ and R²], [R³ and R⁴] and [R⁵ and R⁶] represent a carbon-carbon bond or two hydrogen atoms; 
R² additionally represents alkyl; 
R⁷, R⁸ and R⁹ represent groups including H or OH, 
R¹⁰ has various significances including alkyl and alkenyl; 
X and Y represent groups including O and (H,OH); 
  R¹⁴, R¹⁵, R¹⁶, R¹⁷, R¹⁸, R¹⁹, R²² and R²³ represent H or alkyl; 
R²⁰ and R²¹ represent groups including O, (H,OH) and (H,O-alkyl), 
n is 1, 2, or 3, 
and in addition, Y, R¹⁰ and R²³, together with the carbon atoms to which they are attached, may represent a neterocyclic ring, 
(with certain provisos) are described. Processes for making the compounds and pharmaceutical formulations containing them, eg for use as immunosuppressive agents, are also described.
